function Main() {

  function handleEditAvatarClick() {
    const editAvatarButton = window.querySelector('.profile__avatar-btn');
    console.log(123)
  }

  return (
    <>
      <main className="content">
        <section className="profile">
          <div className="profile__avatar">
            <button className="profile__avatar-btn" type="button" aria-label="Редактировать" />
            <img src="#" className="profile__avatar-image" alt="Фото пользователя" />
          </div>
          <div className="profile__info">
            <h1 className="profile__title">Жак-Ив Кусто</h1>
            <button className="profile__edit-btn" type="button" aria-label="Редактировать" />
            <p className="profile__subtitle">Исследователь океана</p>
          </div>
          <button className="profile__add-btn" type="button" aria-label="Создать" />
        </section>
        <section className="elements" />
      </main>
    </>
  );
}

export default Main;
